import "./Emprestimos.css";
import gif from "../Imagens/Imagens Site/Research paper.gif";
import React, { useState } from "react";

function Emprestimos() {
  const [quantidades, setQuantidades] = useState({
    lapis: 0,
    borracha: 0,
    apontador: 0,
    caneta: 0,
    canetao: 0,
    fitaDurex: 0,
    grampeador: 0,
  });

  const incrementarQuantidade = (item) => {
    if (quantidades[item] < 20) {
      setQuantidades((prevState) => ({
        ...prevState,
        [item]: prevState[item] + 1,
      }));
    }
  };

  const decrementarQuantidade = (item) => {
    if (quantidades[item] > 0) {
      setQuantidades((prevState) => ({
        ...prevState,
        [item]: prevState[item] - 1,
      }));
    }
  };

  const resetarValores = () => {
    setQuantidades({
      lapis: 0,
      borracha: 0,
      apontador: 0,
      caneta: 0,
      canetao: 0,
      fitaDurex: 0,
      grampeador: 0,
    });
    alert("Pedido enviado com sucesso!");
  };

  return (
    <div className="Emprestimos">
      <h1 id="title">Empréstimos de equipamentos</h1>
      <div className="base-site">
        <img src={gif} alt="Research paper" />
        <div className="base-itens">
          <div className="itens">
            <p>Lápis</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("lapis")}>-</button>
              <span>{quantidades.lapis}</span>
              <button onClick={() => incrementarQuantidade("lapis")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Borracha</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("borracha")}>-</button>
              <span>{quantidades.borracha}</span>
              <button onClick={() => incrementarQuantidade("borracha")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Apontador</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("apontador")}>-</button>
              <span>{quantidades.apontador}</span>
              <button onClick={() => incrementarQuantidade("apontador")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Caneta</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("caneta")}>-</button>
              <span>{quantidades.caneta}</span>
              <button onClick={() => incrementarQuantidade("caneta")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Canetão</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("canetao")}>-</button>
              <span>{quantidades.canetao}</span>
              <button onClick={() => incrementarQuantidade("canetao")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Fita durex</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("fitaDurex")}>-</button>
              <span>{quantidades.fitaDurex}</span>
              <button onClick={() => incrementarQuantidade("fitaDurex")}>+</button>
            </div>
          </div>
          <div className="itens">
            <p>Grampeador</p>
            <div className="quantidade">
              <button onClick={() => decrementarQuantidade("grampeador")}>-</button>
              <span>{quantidades.grampeador}</span>
              <button onClick={() => incrementarQuantidade("grampeador")}>+</button>
            </div>
          </div>
        </div>
      </div>
      <button onClick={resetarValores}>Resetar Valores</button>
    </div>
  );
}

export default Emprestimos;
